import React from 'react';
import FlipCard from '../Cards/FlipCard';
import ProfileBack from '../Cards/Profile/ProfileBack';
import ProfileFront from '../Cards/Profile/ProfileFront';
import AsideMenu from '../Menus/AsideMenu';
import profileImg from '../../Image/Profile.png';

const Aside = () => {
    return (
        <div class="container">
            <div class="logo">
                <img src="" />
            </div>
            <div class="profile">
                <FlipCard frontContent={<ProfileFront title="FRONT" subtitle="SUBFRONT" image={profileImg} alt="" />} backContent={<ProfileBack title="BACK" image={profileImg}/>}  />
            </div>
            <div class="menu">
                <AsideMenu />
            </div>
        </div>
    );
}

export default Aside;
